import React from 'react';

function QuoteHeader() {
    return (
        <div className='QuoteHeader container mx-auto bg-white py-10 px-6 sm:w-500 w-960'>
            <div className="container">
                <img className='mx-auto' src='https://www.google.com/url?sa=i&url=https%3A%2F%2Fwww.additudemag.com%2Fmath-anxiety-dyscalculia-learning-strategies%2F&psig=AOvVaw1-WXHO0GBIV_avqLYnDFo8&ust=1673915457302000&source=images&cd=vfe&ved=0CA8QjRxqFwoTCMjA_ZXryvwCFQAAAAAdAAAAABAD' alt='img' /> 
                <h1 class="text-4xl font-bold text-center">Calculator</h1>
            </div>

        </div>
    );
}

export default QuoteHeader;
